import React from 'react'
import TextField from '@mui/material/TextField';
import { Button } from '@mui/material';

const Contact = () => {
  return (
    <div>
        <h1>Contact US</h1>
      <TextField id="standard-basic" label="Name" variant="standard" />
      <TextField id="standard-basic" label="Name" variant="standard" />
      <TextField id="standard-basic" label="Name" variant="standard" />
      <Button>Submit</Button>
    </div>
  )
}

export default Contact
